  position: fixed;
  top: 0;
  left: 0;
  z-index: 999;
  transition: 0.3s;
}

.header_menu_container {
  display: flex;
  align-items: center;
  justify-content: space-between;
}

header .header_menu_container .responsive_menu_icon_container {
  display: none;
