  width: 150px;
  height: 35px;
  font-size: 15px;
  padding: 5% 10%;
  cursor: pointer;
}

header .header_menu_container .header_menu_container_left .menu_wrapper .menu_list .menu_smenu .smenu_list:hover {
  color: #fff;
  background-color: #f15912;
  transition: all 0.5s;
}

header .header_menu_container .logo {
  display: flex;
  justify-content: center;
}


header .header_menu_container .logo a img {
  width: 100%;
  display: block;
}

header .header_menu_container .header_menu_container_right {
  display: flex;
  justify-content: center;
}

header .header_menu_container .header_menu_container_right .menu_wrapper {
  display: flex;
  text-align: center;
}

header .header_menu_container .header_menu_container_right .menu_wrapper .menu_list {
  width: 150px;
  position: relative;
}

header .header_menu_container .header_menu_container_right .menu_wrapper .menu_list>a {
  font-size: 22px;
  color: #ac9272;
}

header .header_menu_container .header_menu_container_right .menu_wrapper .menu_list>a:hover {
  color: #fff;
  transition: all 0.5s;
}


header .header_menu_container .header_menu_container_right .menu_wrapper .menu_list .menu_smenu {
  position: absolute;
  top: 50px;
  left: 0;
  background-color: #fff;
  display: none;
}

header .header_menu_container .header_menu_container_right .menu_wrapper .menu_list .menu_smenu .smenu_list {
  width: 150px;
  height: 35px;
  font-size: 15px;
  padding: 5% 10%;
  cursor: pointer;
}

header .header_menu_container .header_menu_container_right .menu_wrapper .menu_list .menu_smenu .smenu_list:hover {
  color: #fff;
  background-color: #f15912;
  transition: all 0.5s;
